import React, {Component} from 'react';

class CircleArea extends Component {
    constructor (props) {
        super(props);
        this.state = { 
            sections : 6,
            centerX : 0,
            centerY : 0
        }
    }
    render() {
        return (
            <React.Fragment>
                <canvas id="spider-chart" width="300" height="300"></canvas>
            </React.Fragment>
        );
    }
}

export default CircleArea;
